//nolint:scopelint
func TestParseFlags(t *testing.T) {
	tests := []struct {
		name      string
		args      string
		wantCount int
	}{
		{
			name:      "example",
			args:      set0,
			wantCount: 11,
		},
		{
			name:      "actual puzzle",
			args:      set1,
			wantCount: 6590,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			gotCount := day6.CountAnyone(tt.args)
			if gotCount != tt.wantCount {
				t.Errorf("CountAnswersPart1() = %v, want %v", gotCount, tt.wantCount)
			}

			fmt.Printf("AdventOfCode/2020/Day/6/1: count anyone: %d\n", gotCount)
		})
	}
}

//nolint:scopelint
